import './App.css';
import ListItem from './ListItem';
import { Container } from 'react-bootstrap';
import { getRamal } from './RamalService';
import { useEffect, useState } from 'react';
import styled from 'styled-components';

const ListContainer = styled.div`
  display: flex;
  flex-direction: row;
  background-color: #ccc;
  padding: 5px;
`;

function App() {
  const [ramais, setRamal] = useState([]);

  useEffect(() => {
    setRamal(getRamal());
  }, [])

  return (
    <create-container>
      <ListContainer>
      {ramais.map(ramal => {
        return (
          <ListItem
            key={ramal.nome}
            nome={ramal.nome}
            numero={ramal.numero}
          />
        )
      })}
      </ListContainer>
    </create-container>
  );
}

export default App;
